import React, {Component} from "react";
import '../css/ReferAFriend.css'
import referFriend from '../images/referFriend.svg'

class ReferAFriend extends Component{
    render(){
        return (
            <div className="referAFriendContainer">
                <div className="rDiv">
                    <div className="rText">
                        <p className="rTitle">Refer a friend and Get <br/></p>
                        <p className="rDesc">Foresight has something unique for cryto enthusiasts! 
                        If you have a knack for Crypto Currencies like Bitcoin, you can easily place your bids on cryto 11.<br/><br/>
                        Predict the fluctuations in the digital currency and win instant rewards! It will help you ace the 
                        leaderboard and emerge as the ultimate winner in case of a tie-breaaker.</p>
                    </div>
                    <div className="rImgDiv">
                        <img className="rImg" src={referFriend}></img>
                    </div>
                </div>
            </div>
        );
    }
}

export default ReferAFriend;
